  <script id="material" type="model/mtl">
    # Blender 4.2.3 LTS MTL File: 'frog.mtl'
    # www.blender.org
    
    newmtl lambert2SG
    Ns 0.000000
    Ka 1.000000 1.000000 1.000000
    Ks 0.000000 0.000000 0.000000
    Ke 0.000000 0.000000 0.000000
    Ni 1.000000
    d 1.000000
    illum 1
    map_Kd frogBodyTxt.png
    
    newmtl lambert3SG
    Ns 0.000000
    Ka 1.000000 1.000000 1.000000
    Ks 0.000000 0.000000 0.000000
    Ke 0.000000 0.000000 0.000000
    Ni 1.000000
    d 1.000000
    illum 1
    map_Kd frogEyeTxt.png
  </script>

  <script type="module">
    const { vec3, mat4, quat } = glMatrix;

    function updateCamera(t) {
      const x = cameraRadius * Math.cos(t);
      const y = cameraHeight * Math.sin(t);
      const z = cameraRadius * Math.sin(t);

      return [x, y, z];
    }

    // Setup

    const cameraTarget = [0, 0, 0];
    const cameraUp = [0, 1, 0];
    const cameraRadius = 4;
    const cameraHeight = 2;
    const textureMap = {
      "frogBodyTxt.png": "https://files.catbox.moe/ersdqi.avif",
      "frogEyeTxt.png": "https://files.catbox.moe/iaxspj.avif"
    };

    // Shader program
    const vertexShader = compileShader(
      gl.VERTEX_SHADER,
      document.querySelector("script#vertex-shader").text,
    );
    const fragmentShader = compileShader(
      gl.FRAGMENT_SHADER,
      document.querySelector("script#fragment-shader").text,
    );
    const program = linkProgram(vertexShader, fragmentShader);

    let _texCounter = 0;

    // Object and material loading
    const object = new OBJFile(document.querySelector("script#object").text).parse();
    const materials = new MTLFile(document.querySelector("script#material").text).parse();
    const materialMap = {};

    for (const material of materials) {
      for (const mapType of ["Ka", "Kd", "Ks", "d"]) {
        const map = material["map_" + mapType];
        if (map.file == null) continue;

        let fileBase = map.file.split("/");
        fileBase = fileBase[fileBase.length - 1];
        materialMap[material.name] = {
          texture: await loadTexture(textureMap[fileBase]),
          textureUnit: _texCounter++
        };
      }
    }
    console.log("Loaded materials", materialMap);

    for (const model of object.models) {
      // Group faces by material
      const materialGroups = model.faces.reduce((acc, face) => {
        if (!acc[face.material]) {
          acc[face.material] = [];
        }
        acc[face.material].push(face);
        return acc;
      }, {});

      // Construct parts
      model.parts = {};
      for (const [material, faces] of Object.entries(materialGroups)) {
        const vertices = [];
        const normals = [];
        const texCoords = [];
        const indices = [];

        // Track the current index offset to create a correct index buffer
        let currentIndex = 0;

        for (const face of faces) {
          for (const faceVertex of face.vertices) {
            const vertex = model.vertices[faceVertex.vertexIndex - 1];
            vertices.push(vertex.x, vertex.y, vertex.z);

            const normal = model.vertexNormals[faceVertex.vertexNormalIndex - 1];
            normals.push(normal.x, normal.y, normal.z);

            if (faceVertex.textureCoordsIndex !== undefined) {
              const texCoord = model.textureCoords[faceVertex.textureCoordsIndex - 1];
              texCoords.push(texCoord.u, texCoord.v);
            } else {
              // Fallback if no texture coordinate
              texCoords.push(0, 0);
            }

            // Index (for triangles)
            indices.push(currentIndex++);
          }
        }

        model.parts[material] = {
          vertexBuffer: makeBuffer(gl.ARRAY_BUFFER, new Float32Array(vertices)),
          normalBuffer: makeBuffer(gl.ARRAY_BUFFER, new Float32Array(normals)),
          texCoordBuffer: makeBuffer(gl.ARRAY_BUFFER, new Float32Array(texCoords)),
          indexBuffer: makeBuffer(gl.ELEMENT_ARRAY_BUFFER, new Uint16Array(indices)),
          faceCount: indices.length
        };
      }
    }
    console.log("Loaded models", object.models);

    gl.clearColor(0.0, 0.0, 0.0, 1.0);

    function draw(time) {
      canvas.height = window.innerHeight;
      canvas.width = window.innerWidth;
      gl.viewport(0, 0, canvas.width, canvas.height);
      gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
      gl.enable(gl.DEPTH_TEST);

      gl.useProgram(program);

      // Set projection
      const fov = degToRad(60);
      const projectionMatrix = mat4.perspective([], fov, canvas.width / canvas.height, 1, 100);

      // Set camera
      const cameraPos = updateCamera(time * 0.001);
      const viewMatrix = mat4.lookAt([], cameraPos, cameraTarget, cameraUp);
      const viewProjectionMatrix = mat4.multiply(
        [],
        projectionMatrix,
        viewMatrix,
      );

      // Render objects
      for (const model of object.models) {
        for (const [materialName, part] of Object.entries(model.parts)) {
          const material = materialMap[materialName];

          // Set attributes
          setAttr(program, "a_position", part.vertexBuffer);
          setAttr(program, "a_normal", part.normalBuffer);
          setAttr(program, "a_texcoord", part.texCoordBuffer, gl.FLOAT, false, 2);

          // Set object transform
          const translation = [0, 0, 0];
          const rotation = [0, 0, 0];
          const scale = [1, 1, 1];
          const worldMatrix = mat4.fromRotationTranslationScale(
            [],
            quat.fromEuler([], ...rotation),
            translation,
            scale,
          );

          // Set uniforms
          setUniform(program, "u_projection", (loc, val) => gl.uniformMatrix4fv(loc, false, val), projectionMatrix);
          setUniform(program, "u_view", (loc, val) => gl.uniformMatrix4fv(loc, false, val), viewMatrix);
          setUniform(program, "u_world", (loc, val) => gl.uniformMatrix4fv(loc, false, val), worldMatrix);

          // Set texture
          setTexture(material.texture, material.textureUnit, program, "u_texture");

          gl.bindBuffer(gl.ARRAY_BUFFER, part.vertexBuffer);
          gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, part.indexBuffer);
          gl.drawElements(gl.TRIANGLES, part.faceCount, gl.UNSIGNED_SHORT, 0);
        }
      }

      requestAnimationFrame(draw);
    }

    requestAnimationFrame(draw);
  </script>
